import Foundation
@testable import Nearby

class MockSuccessService: Service {
    
    func fetchVenues(latitude: Double, longitude: Double, completion: @escaping (Result<[Venue], ConnectionError>) -> Void) {
        
        guard let data = venuesJSON.data(using: String.Encoding.utf8) else {
            completion(.failure(ConnectionError.couldNotGetDetails))
            return
        }
        
        guard let root: Root = ServiceHelper.decode(data: data) else {
            completion(.failure(ConnectionError.couldNotGetDetails))
            return
        }
        completion(.success(root.response.venues))
    }
}

class MockErrorService: Service {
    
    func fetchVenues(latitude: Double, longitude: Double, completion: @escaping (Result<[Venue], ConnectionError>) -> Void) {
        completion(.failure(ConnectionError.couldNotGetDetails))
    }
}

